import React from 'react';

const Titles = () => {
    return (
        <div>
            <h1 className='title-container__title'>Weather Finder</h1>
            <p className='title-container__subtitle'>Find out temperature, conditions and more ...</p>
        </div>
    );
}

export default Titles;
